import React from 'react';
import { Box, Typography, Container, Grid, Card, CardContent, Link } from '@mui/material';

const projects = [
  {
    title: 'Building Server for Newbie',
    description: 'Server setup guide.',
    link: 'https://github.com/rizkyngrh23/building-server-for-newbie'
  },
  {
    title: 'Cipher Hub',
    description: 'Encryption tools.',
    link: 'https://github.com/rizkyngrh23/cipher-hub'
  },
  {
    title: 'Teralink Generator',
    description: 'Generate download links.',
    link: 'https://github.com/rizkyngrh23/teralink-generator'
  },
  {
    title: 'NMME CNN Training',
    description: 'Train CNN models.',
    link: 'https://github.com/rizkyngrh23/nmme-cnn-training'
  }
];

const Projects: React.FC = () => {
  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Box sx={{ textAlign: 'center', mb: 4 }}>
        <Typography variant="h2" component="h1" gutterBottom>
          Projects
        </Typography>
      </Box>
      <Grid container spacing={4}>
        {projects.map((project, index) => (
          <Grid item xs={12} sm={6} md={3} key={index}>
            <Card sx={{ height: '100%' }}>
              <CardContent>
                <Typography variant="h6">{project.title}</Typography>
                <Typography variant="body2">{project.description}</Typography>
                <Link href={project.link} target="_blank" sx={{ textDecoration: 'none', '&:hover': { textDecoration: 'underline' } }}>
                  View on GitHub
                </Link>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
      <Box sx={{ textAlign: 'center', mt: 4 }}>
        <Typography variant="body2">&copy; 2024 Rizky Portfolio Website</Typography>
      </Box>
    </Container>
  );
};

export default Projects;
